import React from 'react';
import './CSS/Supermarket.css';
import Counter from "./Components/Counter";
import SuperMarket from "./Components/SuperMarket";

function App() {
  return (
    <div>
      <Counter />
      <hr/>
      <SuperMarket />
    </div>
  );
}

export default App;
